import React from 'react'
import { View, StyleSheet } from 'react-native'
import { Text, Input } from 'react-native-elements'

const Register = () => {
    return (
        <View style={styles.main}>
           <Text>Register</Text>
        </View>
    )
}

export default Register


const styles = StyleSheet.create({
    main:{
        flex:1
    }
})
